@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'gallery';
}
<section class="bg-green-600">
  <h1 class="text-3xl font-bold underline">
    Hello world!
  </h1>
</section>
